// src/components/ProjectTable.js
import React from 'react';
import { Link } from 'react-router-dom'; // Import Link from react-router-dom
import '../styles/ProjectTable.css';

const ProjectTable = ({ projects, deleteProject }) => {
  return (
    <table className="project-table">
      <thead>
        <tr>
          <th>Project Name</th>
          <th>Actions</th>
        </tr>
      </thead>
      <tbody>
        {projects.map(project => (
          <tr key={project.id}>
            {/* Use Link component to make project name clickable */}
            <td><Link to={`/project/${project.id}`}>{project.name}</Link></td>
            <td>
              <button onClick={() => deleteProject(project.id)}>Delete</button>
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default ProjectTable;
